import { Component } from "react";
import Meta from "../components/Meta";
import Header from "../components/Header";
import "../styles.scss";

class Page extends Component {
    render() {
        return (
            <>
                <Meta />
                <main className="main">
                    <Header />
                    {this.props.children}
                    asdf
                </main>
            </>
        );
    }
}

export default Page;
